import React from 'react';

import classes from './otp.module.css';

function Otp(props){
    return(
        <div>
            <form>
                <p>Enter OTP</p>
                <div>
                    <input 
                        type= "text" 
                        maxLength= "1"
                        required 
                        className={classes.textBox}
                        >
                    </input>
                </div>
            </form>
        </div>
    );
}

export default Otp;
